import React from 'react';

const resumeText = `
EXPERIENCE
- Work 1
  - did stuff
  - additional things
- Work 2
  - did more stuff
  - did other stuff

EDUCATION
- ASU Bachelors
- UW Bootcamp
`;

export function Resume() {
    return (
        <>
            <h2>Resume</h2>
            <section>
                {resumeText.split('\n').map(str => <p>{str}</p>)}
            </section>
        </>
    );
}
